import React from "react";

const Header = () => {
  return (
    <header>
      <nav>
        <ul className="menu">
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">Stories</a>
          </li>
          <li>
            <a href="#">News</a>
          </li>
          {/* <input type="text" placeholder="Find a recipe.."> */}
          {/* <a href="#"><img src="./resources/image/headerfooter/searchbar.png" alt=""></a> */}
          <li>
            <a href="#">Contact</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
